3e    maximum = numbers[0]  # Takes the first value of the list to find maximum and iterates through the list in a manual way\u003cbr\u003e    for num in numbers:  # Checks the numbers in the list\u003cbr\u003e        if num &gt; maximum:  # If taken number is maximum then finalises it\u003cbr\u003e            maximum = num\u003cbr\u003e    return maximum","analysis.embedding.code_embedding"],["\u003cbr\u003e\u003cbr\u003edef find_max(numbers):\u003cbr\u003e    if len(numbers)==0:\u003cbr\u003e        return None\u003cbr\u003e    else:\u003cbr\u003e        Max=numbers[0]\u003cbr\u003e        for i in numbers:\u003cbr\u003e            if i&gt;Max:\u003cbr\u003e                Max=i\u003cbr\u003e        return Max\u003cbr\u003e\u003cbr\u003eprint(find_max([1, 5, 3, 9, 2])) # 9\u003cbr\u003eprint(find_max([-10, -5, -2])) # -2\u003cbr\u003eprint(find_max([])) # None","analysis.embedding.code_embedding"],["def find_max(numbers):\u003cbr\u003e    if len(numbers) == 0:\u003cbr\u003e        return None\u003cbr\u003e    else:\u003cbr\u003e        maxi = numbers[0]\u003cbr\u003e        for i in range(len(numbers)):\u003cbr\u003e            if numbers[i]&gt;maxi:\u003cbr\u003e                maxi = numbers[i]\u003cbr\u003e            else:\u003cbr\u003e                maxi = maxi\u003cbr\u003e        return maxi\u003cbr\u003e\u003cbr\u003eprint(find_max([1,5,3,9,2]))\u003cbr\u003eprint(find_max([-10,-5,-2]))\u003cbr\u003eprint(find_max([]))","analysis.embedding.code_embedding"],["def find_max(n:list):\u003cbr\u003e    if len(n)==0:\u003cbr\u003e        return \"None\"\u003cbr\u003e    else:\u003cbr\u003e        largest=n[0]\u003cbr\u003e        for i in range (len(n)):\u003cbr\u003e            if n[i]&gt;largest:\u003cbr\u003e                largest=n[i]\u003cbr\u003e        return largest\u003cbr\u003e\u003cbr\u003eprint(find_max([1,5,3,9,2]))#9\u003cbr\u003eprint(find_max([-10,-5,-2]))#-2\u003cbr\u003eprint(find_max([]))#none","analysis.embedding.code_embedding"],["def find_   function updateSearch(query) {
